участники Великой Отечественной войны - граждане, указанные в подпунктах "а" - "ж" и "и" подпункта 1 пункта 1 статьи 2 Федерального закона "О ветеранах";

граждане, пострадавшие в результате радиационных или техногенных граждане, пострадавшие в результате катастрофы на катастроф, - Чернобыльской АЭС, а также в результате других радиационных или техногенных катастроф;

нетрудоспособные граждане - инвалиды, в том числе инвалиды с детства, дети-инвалиды, дети в возрасте до 18 лет либо дети, достигшие возраста 18 лет и завершившие обучение по основным образовательным программам основного общего или среднего общего образования в организациях, осуществляющих образовательную деятельность, на период до 1 сентября года, в котором завершено указанное обучение (далее - дети,

наступила в результате их противоправных действий), имеющим право на пенсию по случаю потери кормильца, предусмотренную пунктом 3 статьи 8 настоящего Федерального закона. Им могут устанавливаться:

смерть

либо пенсия по случаю потери кормильца, предусмотренная пунктом 4 (с применением пункта 5) статьи 15 настоящего Федерального закона, и социальная пенсия по инвалидности, предусмотренная подпунктами 2 и 21 пункта 1 (с применением пункта 2) статьи 18 настоящего Федерального закона;

либо страховая пенсия по случаю потери кормильца и социальная пенсия по инвалидности, предусмотренная подпунктами 2 и 21 пункта 1 (с применением пункта 2) статьи 18 настоящего Федерального закона;

либо пенсия по случаю потери кормильца, предусмотренная пунктом 4 (с применением пункта 5) статьи 15 настоящего Федерального закона, и страховая пенсия по инвалидности (страховая пенсия по старости);

(Дополнение подпунктом - Федеральный закон от 13.07.2024 № 184-ФЗ)

Пенсия по инвалидности участникам Великой Отечественной войны

назначается в следующем размере:

инвалидам I группы - 250 процентов размера социальной пенсии, указанного в подпункте 1 пункта 1 статьи 18 настоящего Федерального закона;

инвалидам II группы - 200 процентов размера социальной пенсии, указанного в подпункте 1 пункта 1 статьи 18 настоящего Федерального закона;

инвалидам III группы - 150 процентов размера социальной пенсии, указанного в подпункте 1 пункта 1 статьи 18 настоящего Федерального закона.

(Пункт в редакции Федерального закона от 24.07.2009 № 213-ФЗ)

Пенсия по инвалидности гражданам, награжденным знаком "Жителю блокадного Ленинграда", гражданам, награжденным знаком "Житель осажденного Севастополя", и гражданам, награжденным знаком "Житель осажденного Сталинграда", назначается в следующем размере: (В редакции федеральных законов от 22.12.2020 № 431-ФЗ, от 28.04.2023 № 137-ФЗ) инвалидам I группы - 200 процентов размера социальной пенсии, указанного в подпункте 1 пункта 1 статьи 18 настоящего Федерального закона;

инвалидам II группы - 150 процентов размера социальной пенсии, указанного в подпункте 1 пункта 1 статьи 18 настоящего Федерального закона;

инвалидам III группы - 100 процентов размера социальной пенсии, указанного в подпункте 1 пункта 1 статьи 18 настоящего Федерального закона.

(Дополнение пунктом - Федеральный закон от 25.11.2006 № 196-ФЗ) (В

редакции Федерального закона от 24.07.2009 № 213-ФЗ)

Пенсия по инвалидности гражданам, ставшим инвалидами вследствие катастрофы на Чернобыльской АЭС либо в результате других радиационных или техногенных катастроф, назначается в следующем размере: инвалидам I группы - 250 процентов размера социальной пенсии, предусмотренного подпунктом 21 пункта 1 статьи 18 настоящего Федерального закона; (В редакции Федерального закона от 05.04.2013 № 51-ФЗ)

инвалидам II группы - 250 процентов размера социальной пенсии, предусмотренного подпунктом 1 пункта 1 статьи 18 настоящего Федерального закона;

инвалидам III группы, в том числе на иждивении которых находятся нетрудоспособные члены семьи, указанные в пунктах 1, 3 и 4 части 2 и части 3 статьи 10 Федерального закона "О страховых пенсиях", - в размере, равном разнице между 250 процентами размера социальной пенсии, предусмотренного подпунктом 1 пункта 1 статьи 18 настоящего Федерального закона,

Пенсия по случаю потери кормильца членам семей граждан, пострадавших в результате радиационных или техногенных катастроф, назначается в следующем размере: детям, потерявшим обоих родителей, или детям умершей одинокой матери - 250 процентов размера социальной пенсии, предусмотренного подпунктом 1 пункта 1 статьи 18 настоящего Федерального закона (на каждого ребенка);

другим нетрудоспособным членам семьи умершего кормильца - 125 процентов размера социальной пенсии, предусмотренного подпунктом 1 пункта 1 статьи 18 настоящего Федерального закона, на каждого нетрудоспособного члена семьи.

(Пункт в редакции Федерального закона от 24.07.2009 № 213-ФЗ)

неработающим гражданам, достигшим возраста 55 лет либо являющимся инвалидами, имеющим на своем иждивении нетрудоспособных членов семьи, указанных в пунктах "а", "б" и "г" части третьей статьи 29, статьях 31, 33 и 34 Закона Российской Федерации "О пенсионном обеспечении лиц, проходивших военную службу, службу в органах внутренних дел, Государственной противопожарной службе, органах по контролю за оборотом наркотических средств и психотропных веществ, учреждениях и органах уголовно-исполнительной системы, войсках национальной гвардии Российской Федерации, органах принудительного исполнения Российской Федерации, и их семей": (В от 27.12.2018 № 536-ФЗ, от 01.10.2019 № 328-ФЗ) при наличии одного такого члена семьи - в размере 32 процентов размера социальной пенсии, предусмотренного подпунктом 1 пункта 1 статьи 18 настоящего Федерального закона;

при наличии двух таких членов семьи - в размере 64 процентов размера социальной пенсии, предусмотренного подпунктом 1 пункта 1 статьи 18 настоящего Федерального закона;

при наличии трех и более таких членов семьи - в размере 100 процентов размера социальной пенсии, предусмотренного подпунктом 1 пункта 1 статьи 18 настоящего Федерального закона.

Указанная надбавка начисляется только на тех нетрудоспособных членов семьи, которые не получают трудовую пенсию или пенсию по государственному пенсионному обеспечению.
